import React from 'react'
import Logo from '../logo/Logo'

const Header = props => {
    return (
        <header style={styles.header}>
            <Logo/>
        </header>
    )
};

export default Header

const styles = {
    header: {
        position: 'relative',
        padding: '0',
        margin: '0',
        backgroundColor: 'white',
        width: '100%',
        height: '135px',
        alignContent: 'center',
        boxShadow: '3px 6px 8px -3px RGBA(52,48,62,.15)'
    }
};
